    const menuItems = [
        {
            name: 'Mighty Philly',
            price: 9.99,
            description: 'Philly cheese steak',
            img_src: ''
        }
    ]

    const [menu, setMenu] = useState([]);

    setMenu(menuItems);


    return (
    <div>
        {menu.map((item, index) => 
            <div>{item.name} {item.price}</div>
        )}
    </div>
  )
}

export default Menu
